create table site
(
    siteid           integer                               not null
        constraint site_pkey
            primary key,
    sitecode         varchar(50)                           not null
        constraint site_sitecode_key
            unique,
    projectid        smallint                              not null
        constraint site_projectid_fkey
            references project,
    perspectiveid    smallint                              not null
        constraint site_perspectiveid_fkey
            references perspective,
    covermethodid    smallint                              not null
        constraint site_covermethodid_fkey
            references covermethod,
    scopevascularid  smallint                              not null
        constraint site_scopevascularid_fkey
            references scope,
    scopebryophyteid smallint                              not null
        constraint site_scopebryophyteid_fkey
            references scope,
    scopelichenid    smallint                              not null
        constraint site_scopelichenid_fkey
            references scope,
    plotdimensionsid smallint                              not null
        constraint site_plotdimensionsid_fkey
            references plotdimensions,
    datumid          smallint                              not null
        constraint site_datumid_fkey
            references datum,
    latitude         numeric(12, 9)                        not null,
    longitude        numeric(12, 9)                        not null,
    error            numeric(6, 2) default '-999'::integer not null
);

alter table site
    owner to postgres;

